ages/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=403,0,2118,1170&amp;w=420&amp;h=232&amp;fit=min&amp;auto=format 420w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=404,0,2115,1170&amp;w=640&amp;h=354&amp;fit=min&amp;auto=format 640w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=404,0,2115,1170&amp;w=960&amp;h=531&amp;fit=min&amp;auto=format 960w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=403,0,2118,1170&amp;w=1280&amp;h=707&amp;fit=min&amp;auto=format 1280w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=403,0,2118,1170&amp;w=1600&amp;h=884&amp;fit=min&amp;auto=format 1600w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=403,0,2117,1170&amp;w=1920&amp;h=1061&amp;fit=min&amp;auto=format 1920w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=404,0,2117,1170&amp;w=2240&amp;h=1238&amp;fit=min&amp;auto=format 2240w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=404,0,2117,1170&amp;w=2560&amp;h=1415&amp;fit=min&amp;auto=format 2560w,https://cdn.sanity.io/images/lbvt8rt8/production/6e7aeaeace728351798696ecca0712a7d4e7ef1e-2924x1170.png?rect=403,0,2117,1170&amp;w=2924&amp;h=1616&amp;fit=min&amp;auto=format 2924w"/><img data-sizes="auto" class="lazyload image-0-3-94 image-d68-0-3-427"/></picture><div class="curtain-0-3-283"><div class="leftCurtain-0-3-284 topDown"></div><div class="rightCurtain-0-3-285 topDown"></div></div></div><div class="content-0-3-414"><span class="title-0-3-415">Meet the Artists Behind the Contours of Country Range</span><p class="summary-0-3-416">Decor Systems partnered with four Indigeno